window.bookSummaryJSON = "<p><b><i>The Expanse</i></b><b> meets </b><b><i>The Godfather</i></b><b> in </b><b><i>Empire Earth (The Complete Trilogy): A Space Opera Boxed Set</i></b><b>. Three full Books. 1,000 pages of space opera filled with intrigue, betrayal, and high-octane action that will keep you turning pages long into the night.</b></p> <p>Book 1: <i>Valhalla Station</i><br> Harmony. Security. Obedience. Three decades ago, the Syndicate Corporation saved Earth from climate catastrophe. Now the Company runs the solar system like a well-oiled machine. Its citizens work Sol under rule of corporate law, every aspect of their lives regulated from cradle to grave. Some call that slavery. But does mankind really want to be freed?</p> <p>Book 2: <i>Masada's Gate</i><br> Cult leader Cassandra Kisaan and her Soldiers of the Solar Revolution claim humanity deserves better than indentured servitude under the Syndicate Corporation. Determined to end SynCorp, she attacks Company assets on multiple fronts across the Sol System. Taking Masada Station, where the Company secures its tech secrets, will ensure her final victory. But Enforcer Stacks Fischer and a band of SynCorp loyalists stand in her way...</p> <p>Book 3: <i>Serpent's Fury</i><br> The struggle for the Company's survival comes home to where it all began: Earth. SynCorp and SSR starships prepare for a final, bloody engagement above mankind's birthplace and the seat of the largest corporate empire in history. Meanwhile, planetside, another fight rages against Cassandra herself. The decisive battle for mankind's soul has yet to be decided on the ground or among the stars.&nbsp;</p> <p>Who will live? Who will die? What fate awaits humanity when the dust of battle clears? Buy this Special Edition Boxed Set to experience a sci-fi thrill ride that keeps accelerating, right up to the very end.</p>"; 
